import React from "react";

const HomePage = () => (
  <div className="homepage">
    <div className="directory-menu">
      <div className="menu-item">
        <div className="content">
          <h1 className="title">HATS</h1>
          <h2 className="subtitle">HATS</h2>
        </div>
      </div>
    </div>
  </div>
);

export default HomePage;
